import React, { Component } from "react";
import { Link } from 'react-router-dom';
import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import Avatar from "@material-ui/core/Avatar";
import GroupIcon from "@material-ui/icons/Group";
import Typography from "@material-ui/core/Typography";
import CircularProgress from "@material-ui/core/CircularProgress";
import {CallToAction, Hero} from "react-landing-page";
import "./App.css";
import UpdateEmployee from "./UpdateEmployee";
import { Button } from '@material-ui/core';
import TextField from "@material-ui/core/TextField/TextField";

const useStyles = makeStyles(theme => ({
    table: {
        minWidth: 600
    },
    avatar: {
        margin: theme.spacing(1),
        backgroundColor: theme.palette.secondary.main
    },
    paper: {
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
        margin: `10px`,
        height: "100%",
        width: "99%",
        marginTop: theme.spacing(7)
    },
    link: {
        color: "rgba(0,0,0,0.65)",
        textDecoration: "none",
        marginLeft: "10%",
        alignSelf: "flex-start",
        "&:hover": {
            color: "rgba(0,0,0,1)"
        }
    }
}));

export default function SearchResults(props) {
    const classes = useStyles();
    const [data, upDateData] = React.useState([]);
    const [firstLoad, setLoad] = React.useState(true);
    const searchVal = props.location.search.substr(1);
    const [delId, setDelId] = React.useState("");
    let isLoading = true;
    let empId;
    let found = false;
    let empArray = new Array();
    let updateEmpInfo;

    const handleIdChange = event => setDelId(event.target.value);

    async function load() {
        let response = await fetch("/api/employee");
        let body = await response.json();
        upDateData(body);
    }

    async function deleteEmp() {
        let resp = fetch("/api/employee/" + empId, {
            method: 'delete'
        })
            .then(response => response.json());
        if(resp !== null) {
            load();
        }
        return resp;
    }

    function getEmpInfo() {
   //     console.log("length is " + empArray.length)
     //   console.log(delId);
        for(let el in empArray)
     //       console.log("Id is " + el.id);
        for(let i = 0; i < empArray.length; i ++) {
 //           if(elem.id == delId) {
            console.log( i + " Name is " + empArray[i].id);
   //             updateEmpInfo.id = elem.id;
   //             updateEmpInfo.name = elem.name;
   //             updateEmpInfo.gender = elem.gender;
   //         }
        }
        console.log("Selected id is " + updateEmpInfo.id);
    }

    if (firstLoad) {
        load();
        setLoad(false);
    }

    if (data.length > 0) isLoading = false;

    return (
        <Hero
            color="black"
            bg="white"
            backgroundImage="data:image/jpeg;base64,"
        >
            <div className={classes.paper}>
                <Avatar className={classes.avatar}>
                    <GroupIcon />
                </Avatar>
                <Typography component="h1" variant="h5">
                    Employee Directory
                </Typography>

                {isLoading ? (
                    <CircularProgress />
                ) : (
                    <TableContainer
                        style={{ width: "80%", margin: "0 10px" }}
                        component={Paper}
                    >
                        <Table className={classes.table} aria-label="simple table">
                            <TableHead>
                                <TableRow>
                                    <TableCell align="center">Id</TableCell>
                                    <TableCell align="center">Name</TableCell>
                                    <TableCell align="center">Department</TableCell>
                                    <TableCell align="center">Gender</TableCell>
                                    <TableCell align="center">Dob</TableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                                {data?.map(row => {
                                    if (row.name === searchVal) {
                         //               empId = row.id;
                                        updateEmpInfo = row;
                                 //       console.log("Row id is " + row);
                                        empArray.push(row);
                                        found = true;
                                        return (
                                        <TableRow>
                                            <TableCell align="center">{row.id}</TableCell>
                                            <TableCell align="center">{row.name}</TableCell>
                                            <TableCell align="center">{row.department}</TableCell>
                                            <TableCell align="center">{row.gender}</TableCell>
                                            <TableCell align="center">{row.dob}</TableCell>
                                        </TableRow>
                                        )}})}
                            </TableBody>
                        </Table>
                    </TableContainer>
                )}
                <Link className={classes.link} to="/search">
                    {" "}
                    <Typography align="left">
                        &#x2190; New search
                    </Typography>{" "}
                </Link>
                {found ? (
                    <div className="mod-buttons">
                        <TextField
                            autoComplete="id"
                            name="Id"
                            variant="outlined"
                            required
                            halfWidth
                            value={delId}
                            id="Id"
                            label="Id"
                            onChange={handleIdChange}
                        />
                        <div className="delete-button">
                        <Button halfWidth
                                variant="contained"
                                color="primary"
                                preventDefault
                                onClick={deleteEmp} component={Link}
                                to="/delete">Delete employee</Button>
                    </div>
                        <div>
                        <Button component={Link}
                                halfWidth
                                variant="contained"
                                color="primary"
                                preventDefault
                                onClick={getEmpInfo}
                                to={{pathname: "/update",
                                    state:
                                        {id: updateEmpInfo.id,
                                         name: updateEmpInfo.name,
                                         department: updateEmpInfo.department,
                                         gender: updateEmpInfo.gender}
                                }}>Update information
                        </Button>
                        </div>
                    </div>
                ) : <div></div>
                }
                {!isLoading && !found ?(
                    <h1>Your search did not produce any matches</h1>
                ) : <div></div>
                }
            </div>
        </Hero>
    );
}
